import { View, Text, Image } from 'react-native'
import React from 'react'

export default function ImageRender(props) {

    const { uri } = props;

    return (


        <View>

            <View style={{ width: '32%', height: 200, marginTop: 0 }}>
                <Image source={{ uri: uri }} style={{ width: '100%', height: '100%', resizeMode: 'stretch' }} />
            </View>

        </View>


    )
}
